import React from 'react';
import styles from "./stylesheets/ETicket.module.css";

const ETicket = (props) => (
    <div className={styles.ticketbox}>
        <p>ETICKET</p>
        <h2>{props.title}</h2>
    </div>
);

export default ETicket;
